def get_first_line_csv_on_queue(file):
    with open(file, newline='') as f:
        reader = csv.reader(f)
        return next(reader)[0]

def remove_first_csv_line(file):
    try:
        with open(file, 'r+') as fp:
            lines = fp.readlines()
            if len(lines) > 0:
                fp.seek(0)
                fp.truncate()
                fp.writelines(lines[1:])                    
    except:
        return 

def get_save_post():
    current_link = get_first_line_csv_on_queue(CSV_FILE_POSTS)
    if(current_link is not None):
        remove_first_csv_line(CSV_FILE_POSTS)
        get_post_data(current_link)
    time.sleep(5 * 60)

