def get_posts_links():
    counter_page = 0
    for key in provinces:
        print("provinces: " + key)
        req = s_html_session.get(provinces[key], headers={'User-Agent': 'Mozilla/5.0'})
        req = BeautifulSoup(req.content, 'html.parser')
        #req.html.render(sleep=10)
        while(True):
            print("pagination " + str(counter_page))
            #province, link, saved
            listings = req.html.xpath('//*[@class="l1ovpqvx bn2bl2p dir dir-ltr"]')
            #print(listings)
            for post in listings:
                p = str(post)
                p_f = p[p.index("href='") + 6:]
                p_l = p_f[:p_f.index("' ")]
                link = "https://www.airbnb.com" + p_l
                save_to_csv_file([link], CSV_FILE_POSTS)
                save_to_csv_file([key,link,False], CSV_FILE_MONGO)
                #print([key,link,False])
            
            time.sleep((15 * 60) + 30)
            next_page = get_next_in_pagination(req)
            print(next_page)
            req.close()
            req = s_html_session.get(next_page, headers={'User-Agent': 'Mozilla/5.0'})
            req.html.render(sleep=10)
            
            if(next_page == "" or next_page == None):
                break


def get_posts_link(link):
    req = s_html_session.get(link, headers={'User-Agent': 'Mozilla/5.0'})
    req.html.render(sleep=30)
    listings = req.html.xpath('//*[@class="l1ovpqvx bn2bl2p dir dir-ltr"]')
    #print(listings)
    for post in listings:
        p = str(post)
        p_f = p[p.index("href='") + 6:]
        p_l = p_f[:p_f.index("' ")]
        link = "https://www.airbnb.com" + p_l
        save_to_csv_file([link], CSV_FILE_POSTS)
        save_to_csv_file([link,link,False], CSV_FILE_MONGO)
        #print([key,link,False])
    req.close()
      

